def count_group_formations(N, K):
    cache = [[-1] * (N + 1) for _ in range(N + 1)]

    def solve(n, k):
        if k > n:
            return 0
        if k > n // 2:
            return 1
        if cache[n][k] != -1:
            return cache[n][k]
        _sum = solve(n - k, k) + solve(n, k + -1)
        cache[n][k] = _sum
        return _sum
    return solve(N, K)
